    return (
        <>
          <img src="../assets/img/ok.png" alt="success" className="screen3__ico" />
          <h2>Ha habido un error</h2>
          <h3>No hemos podido modificar tu Password Manager. Inténtalo más tarde.</h3>
          <button className="btn btn-primary" type="submit">Siguiente <i className="bi bi-chevron-right screen3__button"></i></button>
        </>
    )
}
